import React from 'react';
import InfoBox from '../components/InfoBox';
import { Link } from 'react-router-dom';



const PeriodHealth = () => {
  return (


    <div className="container mx-auto px-4 py-8"
    style={{
      backgroundImage: 'url("/images/home-bg.jpg")',
      backgroundSize: 'cover',
      backgroundPosition: 'center',
      backgroundAttachment: 'fixed'
    }}>
      <h1 className="text-3xl font-bold text-purple-800 mb-8">Ayurvedic Glow: Skin & Hair Wellness </h1>

      {/* Navigation Section */}
      <section className="mb-12">
        <div className="grid md:grid-cols-3 gap-6">
          <Link to="/natural-remedies" className="block">
            <div className="bg-white p-6 rounded-lg shadow-md hover:shadow-lg transition-shadow">
              <h3 className="text-xl font-semibold text-purple-700 mb-2">Ayurvedic Skin Therapy</h3>
              <p className="text-gray-800 text-sm mb-4">Ancient herbal remedies for glowing, healthy skin. </p>
            </div>
          </Link>
          <Link to="/blood-color-guide" className="block">
            <div className="bg-white p-6 rounded-lg shadow-md hover:shadow-lg transition-shadow">
              <h3 className="text-xl font-semibold text-purple-700 mb-2">Ayurvedic Hair Therapy</h3>
              <p className="text-gray-800 text-sm mb-4">Natural nourishment for strong, shiny, and healthy hair.</p>
            </div>
          </Link>

        </div>

      </section>


    </div>
  );
};

export default PeriodHealth;
